    .container{
        
        display: grid;
        grid-template-rows: 0.75fr 9fr 1fr;

        border-radius: 3.5vh;
        width: 60vw;
        height: 90vh;
        background-color: #ffd900;
        
        margin: 3%;
        border-left: #ffd900 1vh solid;
        border-right: #ffd900 1vh solid;
        border-bottom: #ffd900 1vh solid;
        
    }

    .container h1 {
        justify-self: center;
        align-self: center;

        background-color: #dbba00;
        border-radius: 5px;
        padding: 5px;
    }

    .container h2{
        justify-self: center;
        align-self: center;

        font-size: 18px;
        background-color: #000000;
        border-radius: 5px;
        padding: 5px;
    }

    .memory-grid{
        display: grid;
        width:100%;
        height: 100%;
        background-color: #c3ac00;
        

        
        padding: 2vh;
        border: solid 0.3vh black;
        border-radius: 5vh;

        grid-template-columns:repeat(4, 1fr);
        grid-template-rows:repeat(3, 1fr);
        grid-gap: 2vh;

    }

    .card:not(.flipped):hover{
        transform:scale(1.05)
    }

    .card {
        display:flex;
        size: 100%;
        border-radius: 2.5vh;

        background-color: #000000;
        border: solid 0.1vh #ffea00;
        position:relative;
        transform-style: preserve-3d;
        transition: transform 1s;
    }

    .card img{
        image-rendering: optimizeSpeed;           
        image-rendering: -o-crisp-edges;            
        image-rendering: pixelated;                 
        image-rendering: optimize-contrast;         
        -ms-interpolation-mode: nearest-neighbor;   
        
        position:absolute;
        overflow:hidden;
        width: 100%;
        height: 100%;
        border-radius: 2.5vh;
        
        backface-visibility: hidden;
        
    }
    
    .back{
        background-color: #000000;
        
    }
    
    .front{
        transform: rotateY(180deg);   
    }


    .flipped{
        transform: rotateY(180deg);

    }

    
    @media (min-height: 600px){
    .memory-grid{
        grid-template-columns: repeat(4, 1fr);
        grid-template-rows: repeat(3, 1fr);
    }
    }
    @media (max-height: 700px){
    .memory-grid{
        grid-template-columns: repeat(6, 1fr);
        grid-template-rows: repeat(2, 1fr);
    }
